import React, { Component } from 'react';
import { Box, Button } from '@material-ui/core';

const styles = {
  container: {
    width: '100%',
    backgroundColor: 'grey',
    height: 60,
  },
  dataContainer: {
    display: 'flex',
    flexDirection: 'row',
    alignItems: 'center',
  },
};
export default class index extends Component {
  render() {
    let { username } = this.props;
    return (
      <Box style={styles.container}>
        {username ? (
          <Box style={styles.dataContainer}>
            <Box
              style={{ justifyContent: 'flex-start', flex: 1, display: 'flex' }}
            >
              <p style={{ fontSize: 12, margin: 10 }}>{username}</p>
            </Box>
            <Box
              style={{ justifyContent: 'flex-end', flex: 1, display: 'flex' }}
            >
              <Button>Logout</Button>
            </Box>
          </Box>
        ) : null}
      </Box>
    );
  }
}
